import React from "react";

const BookingModal = props => {
  const { open, closeModal } = this.props;
  return (
    <div>
      <Modal open={open} onClose={closeModal} center>
        <h2>Simple centered modal</h2>
      </Modal>
    </div>
  );
};

export default BookingModal;
